import React, { useState, Fragment, useContext } from "react";

import Axios from "axios";

import {
  Row,
  Col,
  Card,
  CardBody,
  Button,
  Label,
  Input,
  Container,
} from "reactstrap";

import ReadOnly from "./ReadOnly";
import EditableData from "./EditableData";

import { PlacesContext } from "../PetPlaces/PlacesContext";

import "./DataTables.css";

const DataTable = () => {
  const { places, addNew, columns } = useContext(PlacesContext);
  const [placesValue, setPlacesValue] = places;
  const [addNewValue, setAddNewValue] = addNew;
  const [columnsValue, setcolumnsvalue] = columns;

  //USR DATA

  const [title, setTitle] = useState("");
  const [address, setAddress] = useState("");
  const [longituide, setLongitude] = useState("");
  const [latitude, setLatitude] = useState("");
  const [startTime, setStartTime] = useState("");
  const [endTime, setEndTime] = useState("");
  const [postalCode, setPostalCode] = useState("");
  const [category, setCategory] = useState("");
  const [phone, setPhone] = useState("");
  const [fb, setFb] = useState("");
  const [insta, setInsta] = useState("");
  const [twitter, setTwitter] = useState("");
  const [url, setUrl] = useState("");
  const [email, setEmail] = useState("");

  const [titleAdded, setTitleAdded] = useState(null);
  const [addressAdded, setAddressAdded] = useState(null);
  const [longituideAdded, setLongitudeAdded] = useState(null);
  const [latitudeAdded, setLatitudeAdded] = useState(null);
  const [startTimeAdded, setStartTimeAdded] = useState(null);
  const [endTimeAdded, setEndTimeAdded] = useState(null);
  const [postalCodeAdded, setPostalCodeAdded] = useState(null);
  const [categoryAdded, setCategoryAdded] = useState(null);
  const [phoneAdded, setPhoneAdded] = useState(null);
  const [fbAdded, setFbAdded] = useState(null);
  const [instaAdded, setInstaAdded] = useState(null);
  const [twitterAdded, setTwitterAdded] = useState(null);
  const [urlAdded, setUrlAdded] = useState(null);
  const [emailAdded, setEmailAdded] = useState(null);

  const [searchParam, setSearchParam] = useState("");
  const [editContactId, setEditContactId] = useState(null);

  const [fieldsFilled, setFieldsFilled] = useState(null);

  const checkFields = () => {
    if (
      title === "" ||
      address === "" ||
      longituide === "" ||
      latitude === "" ||
      startTime === "" ||
      endTime === "" ||
      postalCode === "" ||
      category === "" ||
      phone === "" ||
      fb === "" ||
      insta === "" ||
      address === ""
    ) {
      setTitleAdded(false);
      setFieldsFilled(false);
    }
  };

  const styles = {
    borderColor: "red",
  };

  const handleEditClick = (event, product) => {
    event.preventDefault();
    setEditContactId(product.id);
  };

  const filteredData = placesValue.filter((place) =>
    place.name.toLowerCase().includes(searchParam.toLowerCase())
  );

  const token =
    "eyJraWQiOiJqYUh6OTFhVytuUSt4S1Jnd0Rjd1pUV0ZsbW1YUTBtZ0V0ZXVsUFFpTmtZPSIsImFsZyI6IlJTMjU2In0..ZHe2dbzV_zClHM_-yzQ8KMHExL2AVxhQJhQGsd5ek6Z23HljPfNXhCI5wXn--HXhhKBSnX5hyUVz3xmKOE_ekf2lRVIiM0qbqODvR2_hvCDlNYeOh2ISgj4z2jC_JekRvI-76Br1kwIyZq2lKkG1eJmccGBB6y3yYst9yvz2TvGJ2imQ5laoDs0Uyz47o9ETG8s3Ap_8yrZycavetSRMhaqUrbeZqRVPf2hi4dWek3hQJfgR_wK_QmLhYw592QwtYClfp_WxHXDVIUv7Hi6RgKhLgylGh2ViWCsGjcc8yAh_5ILybY1PQYN_BH93_3i8rqrxxF0hMdnNi0UiIh142g";

  const bodyParameters = {
    pic: {
      pic: [
        {
          url: "760634d2-f8ec-4caa-9a2d-14a8828cfb5dpetplace.jpg",
        },
        {
          url: "760634d2-f8ec-4caa-9a2d-14a8828cfb5dpetplace.jpg",
        },
      ],
    },
    title: "Hangout",
    title_icon: "760634d2-f8ec-4caa-9a2d-14a8828cfb5dpetplace.jpg",
    social_link: {
      social_link: [
        {
          facebook: "facebook.com",
        },
        {
          instagram: "instagram.com",
        },
      ],
    },
    phone_number: "+9233345678",
    address: "lahore",
    lat: "53.958332",
    long: "â€‘1.080278",
    postcode: "5457",
    start_time: "2021-11-15T12:15:39.658Z",
    end_time: "2021-11-15T12:15:39.658Z",
    email: "m.naveedashfaq@gmail.com",
    web_url: "www.google.com",
    createdAt: "2021-11-15T12:15:39.658Z",
    category: 1,
  };

  const config = {
    headers: { Authorization: `Bearer ${token}` },
  };

  const apiUrl = "http://18.216.174.90:3000/api/petplace";
  checkFields();
  const addPlace = (event) => {
    if (fieldsFilled !== false) {
      Axios.get(apiUrl, config)
        .then((res) => {
          console.log("data: ", res);
        })
        .catch((err) => {
          console.log("data: ", err);
        });
    }
  };

  return (
    <div className="app-container">
      {!addNewValue ? (
        <div>
          <div className="table-top">
            <Input
              placeholder="Search the table by name..."
              style={{ width: "25%", borderRadius: "30px", height: "40px" }}
              onChange={(e) => setSearchParam(e.target.value)}
            />
            <Button
              type="button"
              color="success"
              className="btn-rounded mb-2 me-2"
              onClick={() => {
                setAddNewValue(true);
              }}
            >
              <i className="mdi mdi-plus me-1" /> Add Place
            </Button>
          </div>
          <div style={{ width: "100%", overflow: "auto" }}>
            <table style={{ fontSize: "5px" }}>
              <thead>
                {columnsValue.map((header) => (
                  <th> {header.title} </th>
                ))}
              </thead>
              <tbody>
                {filteredData.map((product) => (
                  <Fragment>
                    {editContactId === product.id ? (
                      <EditableData data={product} />
                    ) : (
                      <ReadOnly
                        data={product}
                        handleEditClick={handleEditClick}
                      />
                    )}
                  </Fragment>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      ) : (
        <div className="input-add-events">
          <Container fluid>
            <Row>
              <Col xs={12}>
                <Card>
                  <CardBody>
                    <Row className="mb-3">
                      <Label
                        htmlFor="example-text-input"
                        className="col-md-2 col-form-label"
                      >
                        Title
                      </Label>
                      <Col md={10}>
                        <Input
                          type="text"
                          placeholder="Add Title"
                          id="title"
                          onChange={(e) => setTitle(e.target.value)}
                          style={!titleAdded ? styles : null}
                        />
                      </Col>
                    </Row>
                    <Row className="mb-3">
                      <Label
                        htmlFor="example-search-input"
                        className="col-md-2 col-form-label"
                      >
                        Address
                      </Label>
                      <Col md={10}>
                        <Input
                          type="text"
                          placeholder="Add Address"
                          id="example-search-input"
                          onChange={(e) => setAddress(e.target.value)}
                        />
                      </Col>
                    </Row>
                    <Row className="mb-3">
                      <Label
                        htmlFor="example-search-input"
                        className="col-md-2 col-form-label"
                      >
                        Longitude & Latitude
                      </Label>
                      <Col md={5}>
                        <Input
                          type="text"
                          placeholder="Add Longitude"
                          id="example-search-input"
                          onChange={(e) => setLongitude(e.target.value)}
                        />
                      </Col>
                      <Col md={5}>
                        <Input
                          type="text"
                          placeholder="Add Latitude"
                          id="example-search-input"
                          onChange={(e) => setLatitude(e.target.value)}
                        />
                      </Col>
                    </Row>
                    <Row className="mb-3">
                      <Label
                        htmlFor="example-time-input"
                        className="col-md-2 col-form-label"
                      >
                        Start Time
                      </Label>
                      <Col md={10}>
                        <Input
                          type="time"
                          defaultValue="13:45:00"
                          id="example-time-input"
                          onChange={(e) => setStartTime(e.target.value)}
                        />
                      </Col>
                    </Row>
                    <Row className="mb-3">
                      <Label
                        htmlFor="example-time-input"
                        className="col-md-2 col-form-label"
                      >
                        End Time
                      </Label>
                      <Col md={10}>
                        <Input
                          type="time"
                          defaultValue="13:45:00"
                          id="example-time-input"
                          onChange={(e) => setEndTime(e.target.value)}
                        />
                      </Col>
                    </Row>
                    <Row className="mb-3">
                      <Label
                        htmlFor="example-search-input"
                        className="col-md-2 col-form-label"
                      >
                        Postal Code
                      </Label>
                      <Col md={10}>
                        <Input
                          type="text"
                          placeholder="Add Postal Code"
                          id="example-search-input"
                          onChange={(e) => setPostalCode(e.target.value)}
                        />
                      </Col>
                    </Row>

                    <Row className="mb-3">
                      <Label className="col-md-2 col-form-label">
                        Category
                      </Label>
                      <Col md={10}>
                        <select
                          className="form-control"
                          onChange={(e) => setCategory(e.target.value)}
                        >
                          <option defaultValue>Select a Category</option>
                          <option value="Resturant">Resturant</option>
                          <option value="Cafe">Cafe</option>
                          <option value="Pub">Pub</option>
                          <option value="Park">Park</option>
                          <option value="Hotel">Hotel</option>
                        </select>
                      </Col>
                    </Row>

                    <Row className="mb-3">
                      <Label
                        htmlFor="example-tel-input"
                        className="col-md-2 col-form-label"
                      >
                        Phone
                      </Label>
                      <Col md={10}>
                        <Input
                          type="tel"
                          placeholder="Add your phone number"
                          id="example-tel-input"
                          onChange={(e) => setPhone(e.target.value)}
                        />
                      </Col>
                    </Row>
                    <Row className="mb-3">
                      <Label
                        htmlFor="example-url-input"
                        className="col-md-2 col-form-label"
                      >
                        Facebook Link
                      </Label>
                      <Col md={10}>
                        <Input
                          type="text"
                          placeholder="Add Facebook Link"
                          id="example-url-input"
                          onChange={(e) => setFb(e.target.value)}
                        />
                      </Col>
                    </Row>
                    <Row className="mb-3">
                      <Label
                        htmlFor="example-url-input"
                        className="col-md-2 col-form-label"
                      >
                        Instagram Link
                      </Label>
                      <Col md={10}>
                        <Input
                          type="text"
                          placeholder="Add Instagram Link"
                          id="example-url-input"
                          onChange={(e) => setInsta(e.target.value)}
                        />
                      </Col>
                    </Row>
                    <Row className="mb-3">
                      <Label
                        htmlFor="example-url-input"
                        className="col-md-2 col-form-label"
                      >
                        Twitter Link
                      </Label>
                      <Col md={10}>
                        <Input
                          type="text"
                          placeholder="Add Twitter Link"
                          id="example-url-input"
                          onChange={(e) => setTwitter(e.target.value)}
                        />
                      </Col>
                    </Row>
                    <Row className="mb-3">
                      <Label
                        htmlFor="example-url-input"
                        className="col-md-2 col-form-label"
                      >
                        Email
                      </Label>
                      <Col md={10}>
                        <Input
                          type="text"
                          placeholder="Add Email"
                          id="example-url-input"
                          onChange={(e) => setEmail(e.target.value)}
                        />
                      </Col>
                    </Row>
                    <Row className="mb-3">
                      <Label
                        htmlFor="example-url-input"
                        className="col-md-2 col-form-label"
                      >
                        URL Web
                      </Label>
                      <Col md={10}>
                        <Input
                          type="text"
                          placeholder="Add URL Web"
                          id="example-url-input"
                          onChange={(e) => setUrl(e.target.value)}
                        />
                      </Col>
                    </Row>
                    <Row className="mb-3">
                      <Label
                        htmlFor="example-search-input"
                        className="col-md-2 col-form-label"
                      >
                        Upload Images
                      </Label>
                      <Col md={10}>
                        <div className="input-group">
                          <input
                            type="file"
                            className="form-control"
                            id="customFile"
                          />
                        </div>
                      </Col>
                    </Row>
                  </CardBody>
                  <div className="add-events-buttons">
                    <Button
                      color="light"
                      type="button"
                      className="waves-effect waves-light me-1"
                      outline
                      onClick={() => {
                        setAddNewValue(false);
                      }}
                    >
                      <i className="ri-close-line align-middle me-2"></i> Cancel
                    </Button>

                    <Button
                      color="success"
                      type="button"
                      className="waves-effect waves-light me-1"
                      onClick={addPlace}
                    >
                      <i className="ri-add-circle-fill align-middle ms-2"></i>
                      Add Place
                    </Button>
                  </div>
                </Card>
              </Col>
            </Row>
          </Container>
        </div>
      )}
    </div>
  );
};

export default DataTable;
